def play(): 

    got_it = False
    low = 1
    high = 100
    #limit = int(math.log(high - low, 2)) + 1
    
    again = True
    guess = ""
    question = ""

    
    print (" Hello child. ")
    print (" My name is Harambe. I was shot on May 28, 2016 by a Cincinati Zoo employee. :( ")
    print (" Don't be sad my child...when I died enough people remembered me so I now will live forever. ")
    print (" Since I no longer have to worry about my body and I am left with only my mind I am gaining a new ability.")
    print (" I am trying to learn to guess any number from " + str(low) + " to " + str(high) + " of your choosing.")
    print (" I am so close to figuring it out I just need a little more help")
    print (" To help me learn please tell me if my guess is higher or lower or h or l.")
    print (" If I guess your answer tell me yes or y.")
    
    guess = (high + low) // 2
    while got_it == False:
        #calculate guess
        
        
        
        #computer asks
        question = print("Is your number "+ str(guess) +"?")
        answer = input()
        #adjust range
        if answer == 'higher' or answer == 'h':
            low = guess + 1
            guess = (high + low) // 2
            
        elif answer == 'lower' or answer == 'l':
            high = guess - 1
            guess = (high + low) // 2
            
        elif answer == 'yes' or answer == 'y':
            got_it = True
            
        else:
            print ("I do not understand child...That answer is dummer than the zoo keeper who shot me!")
            print ("Could you please give me an answer that I understand?")
            
